import React from "react";
import Person from "./Person";

function NameList() {
  const persons = [
    {
      id: 1,
      name: "saroj",
      age: 24,
      skill: "react",
    },
    {
      id: 2,
      name: "niraj",
      age: 20,
      skill: "angular",
    },
    {
      id: 3,
      name: "dhiraj",
      age: 18,
      skill: "javaScript",
    },
  ];
  const personList = persons.map((person) => <Person person={person} />);

  return <div>{personList}</div>;
}

export default NameList;
